let a2 = feature.createAnimation('rotation')

a2.setKeys([{
  frame:300, //standard is 30 fps
  value:feature.rotation.add(new Vector3(0,12.5,0))
}])

setInterval(()=>{
  feature.startAnimations([a2])
},10000)

